		_combine_data: function(oldData, newData) {
			if(_this.debug) {console.log("Start _combine_data");var begincomb = new Date().getTime();}
			if(newData.length > 0) {
				for(newIndex in newData) {
					found = false;
					if(oldData !== undefined  && oldData !== null && oldData.length > 0) {
						for(oldIndex in oldData) {
							if(oldData[oldIndex][0] == newData[newIndex][0]) {
								//same data point
								if(oldData[oldIndex][1] == newData[newIndex][1]) {
									//datapoint is not changed, do nothing with it. 
									found = true;
									break;
								} else {
									//datapoint changed
									oldData[oldIndex][1] = newData[newIndex][1];
									found = true;
									break;
								}
							}
						}
					}
					
					if (!found && oldData !== null) {
						if(oldData === undefined) {
							oldData = new Array();
						}
						//add new data point
						oldData.push(newData[newIndex]);
					}
		
				} 
			}
			if(_this.debug) {
				console.log("End _combine_data. Time:");
				console.log(new Date().getTime() - begincomb);
			}

			return oldData;
		},
		
		_combine_rain_data: function(oldData, newData) {
			if(newData.length > 0) {
				for(newIndex in newData) {
					found = false;
					if(oldData !== undefined  && oldData !== null && oldData.length > 0) {
						for(oldIndex in oldData) {
							if(oldData[oldIndex][0] == newData[newIndex][0]) {
								//same data point
								if((parseFloat(oldData[oldIndex][1]) == parseFloat(oldData[oldIndex - 1][1]) + parseFloat(newData[newIndex][1])) || (parseFloat(oldData[oldIndex][1]) == parseFloat(newData[newIndex][1]))) {
									//oldData datapoint equals previous oldData datapoint + current newData datapoint. data is unchanged
									found = true;
									break;
								} else {
									//oldData datapoint is different than previous oldData datapoint + current newData datapoint. data CHANGED
									if(newData[newIndex][1] == null || newIndex == 0) {
										//the new datapoint is null, ignore and break inside loop.
										found = true;
										break;
									}
									
									if(oldData[oldIndex][1] == null/*  && (newData[newIndex][1] !== newData[newIndex - 1][1]) */) {
										oldData[oldIndex][1] = parseFloat(oldData[oldIndex - 1][1]) + (parseFloat(newData[newIndex][1]) - parseFloat(newData[newIndex - 1][1]))			
										if(_this.debug) {
											console.log("true");
											console.log("oldIndex                :" +oldIndex);
											console.log("newIndex                :" +newIndex);
											console.log("oldData[oldIndex][1]    :" + oldData[oldIndex][1]);
											console.log("oldData[oldIndex - 1][1]:" + oldData[oldIndex - 1][1]);
											console.log("newData[newIndex][1]    :" + newData[newIndex][1]);
											console.log("newData[newIndex - 1][1]:" + newData[newIndex - 1][1]);
										}
										found = true;
										break;
									}
									
									if(_this.debug) {
										console.log("false");
										console.log("oldIndex                :" +oldIndex);
										console.log("newIndex                :" +newIndex);
										console.log("oldData[oldIndex][1]    :" + oldData[oldIndex][1]);
										console.log("oldData[oldIndex - 1][1]:" + oldData[oldIndex - 1][1]);
										console.log("newData[newIndex][1]    :" + newData[newIndex][1]);
										console.log("newData[newIndex - 1][1]:" + newData[newIndex - 1][1]);
									}
									
									found = true;
									break;
								}
							}
						}
					}
					
					if (!found && oldData !== null) {
						if(oldData === undefined) {
							oldData = new Array();
						}
						//add new data point
						oldData.push(newData[newIndex]);
					}
		
				} 
			}
			return oldData;
		},
		
