		_fix_extra_date: function(chart) {
			//this command prevents extra date from showing up in upper left corner
			if(chart.series !== undefined && chart.series.length > 1) {
				if(!chart.series[1].visible) {
					chart.series[1].show();
					chart.series[1].hide();
				} else {
					chart.series[1].hide();
					chart.series[1].show();
				}
			}
		},
		
		_check_data: function(data) {
			for (i = 0; i < data.length; i++)
			{
				if (data[i][1])
				{
					return true;
				}
			}
			return false;
		},
		
		_get_min: function(data) {
			if (data)
			{
				min = data[0][1];
				for (i = 0; i < data.length; i++)
				{
					if (data[i][1])
					{
						min = (data[i][1] < min) ? data[i][1] : min;		
					}
				}
				return min;
			}
		},
		
		_get_min_no_null: function(data) {
			if (data)
			{
				min = 999;
				for (i = 0; i < data.length; i++)
				{
					var check = data[i][1] !== null;
					if (data[i][1] && data[i][1] !== null)
					{
						min = (data[i][1] < min) ? data[i][1] : min;		
					}
				}
				return min;
			}
		},

		
		_create_legend: function(chart) {
			totalWidth = 0;
			currentX = 0;
			currentY = -1;
			height = 9
			fontSize = '12px';
			legendColorBoxWdith = 10;
			legendColorBoxHeight = 9;
			rightBuffer = 35;
			var groups = [];
			var groups_checked = [];
			var bgcolor = "#d4dec9";
			legendWidth = 0;
		
			//currentX =  $(chart.container).width() - totalWidth;
		
			for (var ya in chart.yAxis) {
				y = chart.yAxis[ya].top + 240;
				if (chart.yAxis[ya].top != currentY) {
					legendWidth = 0;
					currentX = 0;
					currentY = chart.yAxis[ya].top; 
					//This yaxis is on the next chart. Get the width of the elements for this charts legend.
					for (ya_width = ya; ya_width < chart.yAxis.length; ya_width++) {
						//parse the yAxis items starting with the current ya index axis.
						//check if this is the same yAxis we started with. If it is, create the legend items, and continue. Else, break the for loop, and create the legend.
						if (chart.yAxis[ya_width].top != currentY) {
							break;	
						} else {
							yAxis = chart.yAxis[ya_width];
							for (var s = 0; s < yAxis.series.length; s++) {
								label = chart.yAxis[ya_width].series[s].name;
		
								//check if label name is NULL. If it is, it should not be shown.	
								if(label == "NULL") {
									continue;
								}
								colorBox = chart.renderer.rect(currentX + 5, -9999, legendColorBoxWdith,legendColorBoxHeight, 0)
									.attr({
										'stroke-width': 2,
										stroke: '#FFFFFF',
										fill: '#FFFFFF', 
										zIndex: 999
									}).add();
								colorBBox = colorBox.getBBox();
								legendWidth += colorBBox.width + 5;
		
								textBBox = chart.renderer.text(label, currentX + 3, -9999)
									.css({
										color: '#000000',
										fontSize: fontSize
									}).attr({
										zIndex: 999
									}).add().getBBox();
								legendWidth += textBBox.width + 3;
							}
						}	
					currentY = chart.yAxis[ya_width].top;
					}
		
					currentX = $(chart.container).width() - legendWidth - rightBuffer;
				}
				
				totalWidth = 0;	
				yAxis = chart.yAxis[ya];
				for (var s = 0; s < yAxis.series.length; s++) {
					color = chart.yAxis[ya].series[s].color;
					label = chart.yAxis[ya].series[s].name;
		
					//check if label name is NULL. If it is, it should not be shown.	
					if(label == "NULL") {
						continue;
					}
					
					var group = chart.renderer
						.g()
						.attr({
							zIndex: 999
						})
						.on('click', function(s,ya) {
							return function() {
								var series = chart.yAxis[ya].series[s];
								if (!series.visible) {
									indexName = ya + "," + s;
		
									//Show the series
									series.show();
		
									//Change the toggle button look to shown 
									groups[indexName].hide();
									groups_checked[indexName].show();
								}
							}	
						}(s,ya))
						.add();
					
					var group_checked = chart.renderer
						.g()
						.attr({
							zIndex: 999
						})
						.on('click', function(s,ya) {
							return function() {
								var series = chart.yAxis[ya].series[s];
								if (series.visible) {
									indexName = ya + "," + s;
		
									//Hide the series
									series.hide();
		
									//Change the toggle button look to hidden
									groups[indexName].show();
									groups_checked[indexName].hide();
								}
							}	
						}(s,ya))
						.add();
		
					colorBox = chart.renderer.rect(currentX + 5, y, legendColorBoxWdith,legendColorBoxHeight, 1)
						.attr({
							'stroke-width': 2,
							stroke:  color,
							fill: color, 
							zIndex: 999
						})
						.add(group);
					colorBox_checked = chart.renderer.rect(currentX + 5, y, legendColorBoxWdith,legendColorBoxHeight, 1)
						.attr({
							'stroke-width': 2,
							stroke:  color,
							fill: color, 
							zIndex: 9
						})
						.add(group_checked);
					colorBBox = colorBox.getBBox();
		
					// VML (IE) does not support relative lineTo commands, so we must use absolute lineTo.
					var x1 = currentX + 6;
					var y1 = y + legendColorBoxHeight - 2;
					var x2 = x1 + 2;
					var y2 = y1 + 2;
					var x3 = x2 + legendColorBoxHeight - 2;
					var y3 = y2 - legendColorBoxHeight;
					check_mark = chart.renderer.path(['M', x1, y1,  'L', x2, y2, 'L', x3, y3])
						.attr({
							'stroke-width': 2,
							stroke: 'black',
							zIndex: 20
						})
						.add(group_checked);
					check_mark_white = chart.renderer.path(['M', x1, y1,  'L', x2, y2, 'L', x3, y3])
						.attr({
							'stroke-width': 4,
							stroke: 'white',
							zIndex: 15
						})
						.add(group_checked);
		
					
					series = chart.yAxis[ya].series[s];
					if(!series.visible) {
						group_checked.hide();
					}
					currentX += colorBBox.width + 5;
		
					tempText = chart.renderer.text(label, currentX + 3, colorBBox.y + colorBBox.height)
						.css({
							color: '#000000',
							fontSize: fontSize
						}).attr({
							zIndex: 999
						})
						.add();
					textBBox = tempText.getBBox();
					currentX += textBBox.width + 3;
		
					indexName = ya + "," + s;
					groups[indexName] = group;
					groups_checked[indexName] = group_checked;
				}
			
			chart.renderer.rect(0, y - 4, $(chart.container).width(), legendColorBoxHeight + 8, 0)
				.attr({
					'stroke-width': 2,
					stroke:  bgcolor,
					fill: bgcolor, 
					zIndex: 9 
				})
				.add();
		
			currentY = chart.yAxis[ya].top;
			}
		},
		
